import React from "react";
import "./Home.css";

function Home() {
  return (
    <div>
      <nav className="navbar navbar-expand-lg">
        <a className="navbar-brand" href="#">Invoice Management System</a>
        <div className="collapse navbar-collapse">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <button className="btn" onClick={() => alert("Login/Register process")}>Login/Register</button>
            </li>
          </ul>
        </div>
      </nav>
      <div className="container mt-5">
        <h1>Welcome to the Invoice Management System</h1>
        <p>This is the home page. Please log in to access your account.</p>
      </div>
    </div>
  );
}

export default Home;
